import React, { useState } from "react";
import { FaCamera } from "react-icons/fa";

type Setting = {
    name: string;
    value: string;
};

type SettingProps = {
    settings: Setting[];
    onSave: (settings: Setting[]) => void;
};

const SettingPage: React.FC = ({ }) => {
    //   const [updatedSettings, setUpdatedSettings] = useState(settings);
    const [updatedSettings, setUpdatedSettings] = useState(false);
    const [avatar_image, setAvatar_image] = useState("");
    const [nickname, setNickname] = useState("John Doe");
    const [username, setusername] = useState("");

    const handleSave = () => {
        // onSave(updatedSettings);
    };

    const handleSettingChange = (index: number, event: React.ChangeEvent<HTMLInputElement>) => {
        // const newSettings = [...updatedSettings];
        // newSettings[index].value = event.target.value;
        // setUpdatedSettings(newSettings);
        setUpdatedSettings(true);
    };

    const handleProfileImageChange = (event: React.ChangeEvent<HTMLInputElement>) => {
        // const file = event.target.files?.[0];
        // if (file) {
        //     const reader = new FileReader();
        //     reader.onloadend = () => {
        //         setProfileImage(reader.result as string);
        //     };
        //     reader.readAsDataURL(file);
        // }
    };


    return (
        <div
            style={{
                backgroundColor: "rgba(132, 0, 0, 0.9)",
                // position: "absolute",
                height: "100vh",
                backgroundSize: "cover",
                backgroundRepeat: "no-repeat",
                backgroundPosition: "center",
                display: 'flex',
                // padding: '0 20px',
                flexDirection: 'column',
                justifyContent: 'space-between',
            }}>
            <div
                style={{
                    display: "flex",
                    alignItems: "center"
                }}>
                {avatar_image ? (
                    <img src={avatar_image} alt="Profile" style={{ width: "150px", height: "150px", borderRadius: "50%" }} />
                ) : (
                    <div>
                        <label htmlFor="profile-image-input">
                            <div
                                style={{
                                    width: "200px",
                                    height: "200px",
                                    borderRadius: "50%",
                                    backgroundColor: "#ccc",
                                    display: "flex",
                                    justifyContent: "center",
                                    alignItems: "center",
                                    cursor: "pointer",
                                    textAlign: "center",
                                    transform: 'translate(10%, 50%)',
                                }}
                            >
                                <FaCamera size={60} color="#fff" />
                            </div>
                            <div style={{
                                // position: 'fixed',
                                fontFamily: "Times New Roman",
                                cursor: "pointer",
                                fontSize: "20px",
                                transform: 'translate(20%, 450%)',
                                textAlign: "justify",
                            }} >
                                Change profile image
                            </div>
                        </label>
                        <input
                            type="file"
                            accept="image/*"
                            id="profile-image-input"
                            onChange={handleProfileImageChange}
                            style={{ display: "none" }}
                        />
                    </div>
                )}
                <div
                    style={{
                        fontSize: "20px",
                        transform: 'translate(20%, 150%)',
                    }}>
                    <label htmlFor="nickname">Nick Name: </label>
                    <input

                        style={{
                            fontSize: "16px",
                            backgroundColor: "#ccc",
                        }}
                        type="text"
                        id="nickname"
                        value={nickname}
                        onChange={(e) => setNickname(e.target.value)}
                    />
                </div>
                <div
                    style={{
                        fontSize: "20px",
                        transform: 'translate(-80%, 270%)',
                    }}>
                    <label htmlFor="username">User Name: </label>
                    <input
                        style={{
                            fontSize: "16px",
                            backgroundColor: "#ccc",
                        }}
                        type="text"
                        id="username"
                        value={username}
                        onChange={(e) => setusername(e.target.value)}
                    />
                </div>
            </div>

            <h1 style={{
                fontFamily: "Times New Roman",
                position: 'fixed',
                transform: 'translate(70%, 2000%)',
                fontSize: 16,
                // zIndex: 66,
            }}>Achievements</h1>
            <div
                // style={{
                //     backgroundColor: "rgba(0, 0, 0, 0.9)",
                //     height: "40vh",
                //     width: "20vh",
                //     backgroundSize: "cover",
                //     backgroundRepeat: "no-repeat",
                //     backgroundPosition: "center",
                //     display: 'flex',
                //     padding: '80 90px',
                //     flexDirection: 'column',
                //     // transform: 'translate(25%, 40%)',
                //     justifyContent: 'space-between',
                // }}
                // style={{
                //     padding: "50px 50px",
                //     // position: "absolute",
                //     // top: "0",
                //     left: "0",
                //     right: "0",
                //     // bottom: "0",
                //     backgroundColor: "rgba(0, 0, 0, 0.5)",
                //     // color: "white",
                //     display: "flex",
                //     textAlign: "center",
                //     justifyContent: "center",
                //     zIndex: "1",
                //   }}
                style={{
                    backgroundColor: "#ccc",
                    padding: "90px 70px",
                    maxWidth: "800px",
                    margin: "210px auto"
                }}
            >

            </div>
            {/* {updatedSettings.map((setting, index) => (
                <div key={setting.name}>
                    <label 
                    htmlFor={setting.name}>{setting.name}:</label>
                    <input
                        type="text"
                        id={setting.name}
                        value={setting.value}
                        onChange={(e) => handleSettingChange(index, e)}
                    />
                </div>
            ))} */}
            {/* {updatedSettings.map((setting, index) => (
                <div key={index}> */}
            <label>
                {/* {setting.name}
                        <input type="text" ></input>
                        value={setting.value} onChange={(event) => handleSettingChange(index, event)} /> */}
            </label>
            {/* </div>))} */}
            <button
                style={{ fontSize: "30px" }}
                onClick={handleSave}>
                Save
            </button>
        </div>
    );
};

export default SettingPage;
